import React from 'react';
import '/Home.css'

function Home() {
    return (
        <div classname="HomeContent">
        <h1>FretFinder</h1>
        <p>The place to find your notes.</p>
        <h2><a href="/Fretboard">Go!</a></h2>
      </div>
    )
}

export default Home;
